import React from 'react'
import { Link } from 'react-router-dom'
import './index'

const About = () => {
  return (
    <div>
      <center>
        <h3>Welcome to about page</h3>
        <Link to='/'>Home</Link> {" "}
        <Link to='/dashboard'>Dashboard</Link>
      </center>
    </div>
  )
}

export default About
